  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0104393 includes profile
  and physical data collected aboard the CYGNUS, HUDSON and PARIZEAU during cruises
  CY98-079, HUD9877, PAR93-032, PAR94-018, PAR95-010, PAR95-034, PAR96-024, PAR97-025,
  PAR98-078 and PAR99-028 in the North Atlantic Ocean from 1993-10-12 to 1999-09-29.
  These data include SALINITY, HYDROSTATIC PRESSURE, TEMPERATURE, SIGMA-THETA and
  POTENTIAL TEMPERATURE. The instruments used to collect these data include CTD. These
  data were collected by Peter C. Smith of Bedford Institute of Oceanography as part
  of GB. The Biological and Chemical Oceanography Data Management Office (BCO-DMO)
  submitted these data to NODC on 2013-01-23.nnThe following is the text of the abstract
  provided by BCO-DMO:nnCTD Data from Eastern Gulf of Maine/Scotian ShelfnnPI:nPeter
  C. SmithnnCoastal Ocean SciencennBedford Institute of OceanographynnDataset:nEastern
  Gulf of Maine/Scotian ShelfnnShips:nCCS Parizeau, CCGS Hudson and CCGS CygnusnnNote:
